import React, { Component } from "react";

class QuizPage extends Component {
  constructor(props) {
    super(props);
  }


  render() {
    return (
      <div id="mainPage">
        <div id="mainPageBody">
          <div id="contentPanel">
            <h2 id="quizTitle">Quiz</h2>
            {this.state.page === "Question"
              ? this.questionPage()
              : this.state.page === "Results"
              ? this.resultPage()
              : this.state.page}
            <button id="submit">
              {this.state.button}
            </button>
          </div>
        </div>
      </div>
    );
  }
}

export default QuizPage;
